import axios from "axios";
const KEY = "AIzaSyBkGrz-7ITMbdVDSxDy8mvOekvFu1DVwPk";
export default axios.create({
  baseUrl: "https://www.googleapis.com/youtube/v3", //dont add slash after v3 in baseURL
  params: {
    part: "snippet",
    maxResults: 5,
    key: KEY,
  },
});
